import React from 'react';
import Style from './Portfolio.'

function Portfolio() {
  return (
    <div>
      <div className='bg-warning'>
        <nav className='navbar'>
          <ul className='navbar-list'>
            <li className='navbar-item'><a href='#'>Hi Word</a></li>
            <li className='navbar-item'><a href='#'>Quem sou eu</a></li>
            <li className='navbar-item'><a href='#'>Conhecimentos</a></li>
            <li className='navbar-item'><a href='#'>Projetos</a></li>
            <li className='navbar-item'><a href='#'>Redes</a></li>
          </ul>
        </nav>
      </div>
    </div>
  );
}

export default Portfolio;
